import React from 'react'
import { Link } from 'react-router-dom'
import './Navigation.css'
import logoHome from "../images/mepelaozen.png"
import whatsapp from "../images/whatsapp.png"
import facebook from "../images/facebook.png"
import instagram from "../images/instagram.png"
import { useDispatch, useSelector } from 'react-redux'
import styled from 'styled-components'
import { logoutUser } from '../store/AuthSlice'
import { toast } from 'react-toastify'


function Navigation() {

  const dispatch = useDispatch()

  const {cartTotalQuantity} = useSelector((state)=>state.cart)
  const auth = useSelector((state)=>state.auth)

  return (
    <nav>

    <div>

<div className='titleLogo'>
    <Link to="/home"><img src={logoHome} alt="לוגו למסך הבית" width="180px"/></Link>



      </div>
      </div>
      <hr></hr>



    <div className='navigateTitle'>
    <Link to="/cart"><svg xmlns="http://www.w3.org/2000/svg" width="35" height="35" fill="currentColor" className="bi bi-handbag-fill" viewBox="0 0 16 16">
  <path d="M8 1a2 2 0 0 0-2 2v2H5V3a3 3 0 1 1 6 0v2h-1V3a2 2 0 0 0-2-2zM5 5H3.36a1.5 1.5 0 0 0-1.483 1.277L.85 13.13A2.5 2.5 0 0 0 3.322 16h9.355a2.5 2.5 0 0 0 2.473-2.87l-1.028-6.853A1.5 1.5 0 0 0 12.64 5H11v1.5a.5.5 0 0 1-1 0V5H6v1.5a.5.5 0 0 1-1 0V5z"/>
</svg> 
<span>{cartTotalQuantity}</span>
</Link>




    <div className="dropdown">
    <Link to="/case" className="dropbtn">אביזרים</Link>
    </div>


    <div className="dropdown">
    <Link to="/samsung"  className="dropbtn">Samsung</Link>
    <div className="dropdown-content">
      <Link to="/samsung/">Sam1</Link>
      <Link to="/samsung/">Sam2</Link>
      <Link to="/samsung/">Sam3</Link>
  </div>
    </div>



    <div className="dropdown">
    <Link to="/airpods"  className="dropbtn">AirPods</Link>
    <div className="dropdown-content">
      <Link to="/airpods/airpods2">AirPods 2</Link>
      <Link to="/airpods/airpods3">AirPods 3</Link>
      <Link to="/airpods/airpodspro">AirPods Pro</Link>
      <Link to="/airpods/airpodspromax">AirPods Pro Max</Link>
  </div>
    </div>


    <div className="dropdown">
    <Link to="/iphone"  className="dropbtn">Iphone</Link>
    <div className="dropdown-content">
    <Link to="/iphone/iphone11">Iphone 11</Link>
    <Link to="/iphone/iphone12">Iphone 12</Link>
    <Link to="/iphone/iphone13">Iphone 13</Link>
    <Link to="/iphone/iphone14">Iphone 14</Link>
  </div>
    </div>


    <div className="dropdown">
    <Link to="/ipad"  className="dropbtn">Ipad</Link>
    <div className="dropdown-content">
    <Link to="/ipad/ipadmini">Ipad Mini</Link>
    <Link to="/ipad/ipadair">Ipad Air</Link>
    <Link to="/ipad/ipadpro">Ipad Pro</Link>
  </div>
    </div>


    <div className="dropdown">
    <Link to="/watch"  className="dropbtn">Watch</Link>
    <div className="dropdown-content">
      <Link to="/watch/applewatch6">Apple Watch 6</Link>
      <Link to="/watch/applewatch7">Apple Watch 7</Link>
      <Link to="/watch/applewatch8">Apple Watch 8</Link>
      <Link to="/watch/applewatchultra">Apple Watch Ultra</Link>
  </div>
    </div>


    <div className="dropdown">
    <Link to="/mac"  className="dropbtn">Mac</Link>
    <div className="dropdown-content">
       <Link to="/mac/imac">Imac</Link>
       <Link to="/mac/macmini">Mac Mini</Link>
      <Link to="/mac/macbookair">Macbook Air</Link>
      <Link to="/mac/macbookpro">Macbook Pro</Link>   
  </div>
    </div>
    </div>


      <hr></hr>





    </nav>
  )
}

export default Navigation

// const Logout = styled.div`
//   color: black;
//   cursor: pointer;
// `


const AuthLinks = styled.div`
display: flex;
justify-content: end;
margin-right: 2rem;

  a{
    &:last-child{
      margin-left: 2rem;
    }
  }
`


const Links = styled.div`
  display: flex;
  div{
    cursor: pointer;
    &:last-child{
      margin-left: 2rem;
    }
  }
`





